  false,\n\t\"url\": null,\n\t\"notes\": \"Two types of data sets generated by our
  project: species inventories and quantitative counts of key organisms. The species
  inventories are a compilation of data collected by Chela Zabin of the Department
  of Zoology of the University of Hawaii in 2001 and by Zabin with the assistance
  of Erin Baumgartner's 9th grade Marine Science class at the Education Laboratory
  School in 2003, 2004 and 2005, through a National Science Foundation Graduate Teaching
  Fellowship. Each site was visited only once each year: by 50 students in 2003 and
  by 25 students in 2004 and 2005.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
